import React, {useEffect, useState} from "react";
import FetchRSIData from "./FetchRSIData";

function RSIAnalysis1({ stockCode }){
    const [RsiData, setRsiData] = useState(null)
    const [recentRsiValue, setRecentRsiValue] = useState(null)

    const handleTodayRsi = (data) => {
        setRsiData(data);
    };

    useEffect(() => {
        if (RsiData && RsiData.length > 0) {
            const recentRsiData = RsiData[RsiData.length - 1];
            const recentRsiValue = recentRsiData.RSI;

            if (recentRsiValue !== recentRsiValue) {
            setRecentRsiValue(recentRsiValue);
        }
        }
    }, [RsiData]);

    return(
        <div>
            <FetchRSIData stockCode={stockCode} onRSIFetch={handleTodayRsi} />
            {recentRsiValue !== null && (
                <p>Latest RSI Value: {recentRsiValue}</p>
            )}
        </div>
    )
}

export default RSIAnalysis1
